import React, { Component } from 'react'
import { Container, Row, Col } from 'react-bootstrap'

export class Home extends Component {
    render() {
        return (
            <div className="home-content">
                <Container>
                    <Row>
                        <Col lg={true}>
                            <h2>About Me</h2>
                            <hr />
                        </Col>
                    </Row>
                </Container>
            </div>
        )
    }
}

export default Home
